INSERT INTO `tbl_psiquicas` (`id_psiquica`, `estado`, `usuario`, `password`, `foto`, `introduccion`, `descripcion`, `signo`, `elemento`, `piedra`, `deleted`) VALUES
	(1, 2, 'MIRANDA', '12345', 'foto_psiquico/sibila.png', NULL, 'Su poder de videncia es muy alto el cual muchas veces solo basta que diga unas cuantas palabras para que pueda ver lo que ocultamente puedes callar. También tiene el poder de ver el futuro en mucha extensión de tiempo por ello sus predicciones pueden ser a largo plazo.\r\n¿Necesitas tomar una decisión urgente que a la larga traerá consecuencias para ti y los que te rodean? Consulta con Miranda ya que ella te hará una predicción a largo plazo y con la certeza del poder de lo más oculto de la selva y sus misteriosas profundidades.\r\n', 'Capricornio', 'Tierra', 'Ónix', 0),
	(2, 2, 'LUNA', '12345', 'foto_psiquico/luna.png', NULL, 'El carácter introvertido de Luna hacía que desde niña sea alguien especial. Y así fue, Luna descubrió que seres buenos le hablaban entre sueños y también poco a poco en susurros. Con el pasar del tiempo descubrió que eran ángeles quienes se comunicaban con ella para darle noticias, advirtiera o alertara a quienes ellos se lo indicaban, y así fue.\r\nElla recibe mensajes y escucha a los ángeles siendo muy acertado y consolador su consejo. Por eso es muy gratificante escucharla. Sentirás mucha paz y tranquilidad.\r\n', 'Leo', 'Fuego', 'Diamante', 0),
	(3, 0, 'JOSIE', '12345', 'foto_psiquico/josie.png', NULL, 'Josie Diez Canseco famosa esotérica, astrologa y tarotista de fama nacional e internacional. Una de las características que distinguen a Josie Diez Canseco es su gran sensibilidad, así como su capacidad de transmitir de manera positiva los mensajes cósmicos a sus consultantes, brindándoles seguridad, apoyo y soluciones.', 'Aries', 'Fuego', 'Cuarso', 0),
	(4, 0, 'SOL', '12345', 'foto_psiquico/estefany.png', NULL, 'Siempre brilló para las personas. En su adolescencia Sol salvó a unos compañeros de un accidente automovilístico. Ella al tener una imagen videncia  advirtió al chofer que más adelante del camino sufrirían un derrumbe y el bus se desbarrancaría pero se burlo  de ella ya que pasaban por un desierto totalmente llano. Más adelante y durante la noche el bus que era más pequeño rozó  un camión de carga de tierra y piedras chocando y cayendo sobre el toda la carga. No hubo muertes por una maniobra que el chofer hizo a tiempo gracias a la advertencia de Sol.\r\nLa videncia de sol y su habilidad para descifrar a través del tarot el pasado, el presente y el futuro de las personas han hecho de ella una excelente consejera y guía espiritual para quienes la consultan. Ella encontró en ello su motivo de vida.\r\n', 'Aries', 'Fuego', 'Jaspe Rojo', 0),
	(5, 0, 'ISABEL', '12345', 'foto_psiquico/estrella.png', NULL, 'Predice a través  de la intensidad del fuego de tu interior. Ella puede sentir a través de tu energía, solo con tu nombre puede ver lo que quieres saber de tu pasado presente y futuro. Isabel tiene la energía de los andes, pues ella creció en una comunidad ancestral y aprendió los secretos del silencio de los cerros.\r\nEn la quietud de su tierra ella descubrió su poder para ver el mas allá y sobre todo comunicarlo a quien necesita saber. Excelente consejera, no dice más de lo que los espíritus le ordenan por precaución y más que nada porque así le ordena un gran poder.\r\n', 'Sagitario', 'Fuego', 'Lapislázuli', 0),
	(6, 0, 'FORTUNA', '12345', 'foto_psiquico/fortuna.png', NULL, 'Ella siempre vivió rodeada de naturaleza lugar de donde aprendió muchos secretos que practicó desde muy joven y los cuales no dudo en compartir con personas allegadas ayudando sorprendentemente a curar y sanar no solo un cuerpo enfermo sino los males espirituales.\r\nAhora es toda una experta de la adivinación y profecía así que una consulta con ella no solo adivinará tu futuro sino que te aconsejará con toda la ciencia de la naturaleza  y sobre todo con amplia experiencia en la mente humana.\r\n', 'Aries', 'Fuego', 'Ámbar Rojo', 0),
	(7, 0, 'RAFAEL', '12345', 'foto_psiquico/RAFAEL.png', NULL, 'Desde niño fue practicando el arte adivinatorio ya que por legado de su abuelo el aprendió como llevar su espíritu y mente a un nivel más elevado donde podía ver más allá del tiempo actúa. El tenia visiones del pasado del presente y del futuro sorprendiendo a más de uno que lo conocía.\r\nÉl se dedicó a aprender de su abuelo el arte de las hierbas y como hacer magia con ellas. Esto combinado con su gran poder mental lo hizo aprender más sobre cómo ayudar a través de ellas y más que nada el arte de la curación.\r\nSus baños y rituales serán siempre de mucha ayuda pero sobre todo ese don de adivinar y ver será lo que traerá a tu vida la tranquilidad que buscas. \r\n', 'Capricornio', 'Tierra', 'Turmalina negra', 0),
	(8, 0, 'LUISA', '12345', 'foto_psiquico/luisa.png', NULL, 'El poder enigmático de Luisa viene desde sus antepasados. Desde su niñez vivida a orillas de una playa, capto y desarrollo todo aquellos misterios destacando en el poder adivinatorio y sobre todo en el poder de persuasión para ayudar a los demás.\r\nComenzó sus vaticinios con gente amiga los cuales no dudaron, a pesar de su temprana edad en consultarle sobre aquello que les iba a pasar. Pero algo destaca en ella y es su sensibilidad para persuadir y aconsejar en aquello que tanto angustia. Llámala y tendrás la solución acertada que tanto necesitas.\r\n', 'Sagitario', 'Fuego', 'Cuarzo morado', 0),
	(9, 0, 'WAYRA', '12345', 'foto_psiquico/wayra.png', NULL, 'Wayra desde muy pequeña veía a su abuela leer el tarot y, sin que nadie se lo indicara, empezó a interpretar cada arcano. Con solo cuatro años miraba una baraja del tarot y podía adivinar el significado de la carta. Ya  con ocho años podía predecir el futuro, adivinando los acontecimientos más importantes de su familia.  Antes de morir, su abuela le heredo sus primeras  cartas de tarot. \r\nWayra es muy acertada en sus predicciones, esto acompañada de su gran  sensibilidad la ha llevado a desarrollar  un alto sentido emocional que es la guía perfecta para un consejo adecuado y atinado para tu vida.\r\n', 'Escorpio', 'Agua', 'Granate', 0),
	(10, 0, 'ZAFIRO', '12345', 'foto_psiquico/lucero.png', NULL, 'Busca siempre la armonía y sobre todo la verdad de lo que quieres saber. Sus conocimientos esotéricos vienen de lo más profundo de su corazón y de su acertada intuición. Con ella querrás saber lo que te depara el futuro porque a pesar del pasar del tiempo difícilmente se equivocará.\r\nSus consejos hacen que tengas un resultado positivo y provechoso de tus objetivos así que no dudes en ponerlos en práctica si quieres lograr lo que tanto anhelas. La magia y su videncia será su mejor carta de presentación así que cuenta con ella para ayudarte a decidir lo mejor para ti vida.\r\n', 'Aries', 'Fuego', 'Rubí', 0),
	(11, 0, 'TOPACIO', '12345', 'foto_psiquico/topacio.png', NULL, 'Topacio  fue involucrándose y conociendo cada vez más hasta que tras un tiempo descubrió que ella había desarrollado esa magia y sabiduría que la hacía ver más allá de lo que las personas pueden ver. Muy acertada con descubrir lo oculto de las personas, pronto se encontró practicando diferentes artes mágicas entre ellas el tarot, el cual le hablaba solo y con casi un cien por ciento de asertividad.\r\nDeseas un consejo sabio, un acertado vaticino y llenarte de esa energía que solo la magia te puede dar, Topacio es la mejor respuesta a tus inquietudes.\r\n', 'Escorpio', 'Agua', 'Ópalo de fuego', 0),
	(19, 0, 'SOLEIL', '12345', 'foto_psiquico/nelida.png', NULL, 'Vidente de nacimiento y tarotista. Como psíquica tiene las capacidades de clarividencia. Hace consultas de diferentes Oráculos, rituales esotéricos, armonizaciones y limpiezas por más de 25 años. \r\nSe ha especializado a través de los años en manejos energéticos y en relaciones de parejas. Con la ayuda de sus maestros, guías espirituales, se pone a tu completa disposición para orientarte, ayudarte con tus dudas y dificultades, para que venzas tus problemas, trabas y obstáculos, y tomes las decisiones correctas y acertadas que te ayudarán en la apertura de caminos para la prosperidad espiritual, física y material.\r\n', 'Virgo', 'Tierra', 'Ámbar naranja', 0),
	(20, 0, 'LUCIA', '12345', 'foto_psiquico/lucia.png', NULL, 'Lucia desde pequeña tenía el don de presentir los acontecimientos más importantes de personas totalmente extrañas a ella. Una vez de niña le dijo a su madre que había visto en sueños a un hombre dentro de un lago nadando feliz y perdiéndose en el horizonte. Luego resulto que un amigo del extranjero de su padre, el cual ella nunca conoció y sufría de una enfermedad muy penosa había fallecido dándose un baño de tina. \r\nAsí Luna fue teniendo sueños e imágenes reveladoras que la inclinaron a conocer más sobre el mundo esotérico y de la videncia siendo ahora lo que más le gusta hacer ya que sus consejos y predicciones han ayudado a muchas personas las cuales ahora sobrellevan mejor sus vidas.', 'Aries', 'Agua', 'Amatista', 0);
