INSERT INTO `tbl_zodiaco` (`id_zodiaco`, `nombre`, `imagen`, `fecha`, `descripcion`, `color`, `planeta`, `frase`, `elemento`, `piedra`, `audio_semanal`, `audio_ritual`, `audio_conquistas`) VALUES
	(1, 'Aries', 'ARIES.png', '20 Mar. 19 Abr', 'Un Aries es una persona llena de energía y entusiasmo. Pionero y aventurero, le encantan los retos, la libertad y las nuevas ideas. A los Aries les gusta liderar y prefieren dar instrucciones a recibirlas. Son independientes y preocupados por su propia ambición y objetivos. Tienen una energía envidiable que a veces les lleva a ser agresivos, inquietos, argumentativos, tercos. Es fácil ofender a los Aries y, cuando se sienten ofendidos, es difícil hacer las paces con ellos. Aries es el primer signo del zodiaco y, en este sentido, su papel es empezar algo y liderar. Si un Aries empieza a creer en una buena causa, luchará sin descanso para promocionarla.', 'red', 'Marte', 'Yo soy', 'Fuego', 'Granate', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(2, 'Tauro', 'TAURO.png', '20 Mar. 19 Abr', 'Un Tauro suele ser práctico, decidido y tener una gran fuerza de voluntad. Los Tauro son personas estables y conservadores, seguirán de forma leal un líder en el que tienen confianza. Les encanta la paz y tranquilidad y son muy respetuosos con las leyes y las reglas. Respetan los valores materiales y evitan las deudas. Son un poco reacios al cambio. Son más prácticos que intelectuales y, como les gusta la continuidad y la rutina, suelen ser de ideas fijas. Los Tauro son prudentes, estables y tienen un gran sentido de la justicia. No suelen hundirse ante las dificultades sino que siguen adelante hasta salir. A veces los Tauro pueden ser demasiado rígidos, argumentativos, egocéntricos y tercos. A los Tauro les gustan las cosas bellas y suelen ser aficionados al arte y la música. Algunos Tauro tienen una fe religiosa poco convencional y muy fuerte. Les encantan los placeres de la vida, el lujo, la buena comida y bebida. De hecho, los Tauro deben esforzarse para no dejarse llevar por la tentación de satisfacer en exceso estos gustos.', 'green', 'Venus', 'Yo tengo', 'Tierra', 'Cuarzo rosado', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(3, 'Géminis', 'GEMINIS.png', '20 Mar. 19 Abr', 'Géminis es el signo de los gemelos y, como tal, su carácter es doble, bastante complejo y contradictorio. Por un lado es versátil, pero por el otro puede ser insincero. Suelen tener elegancia y caer en los errores de los jóvenes. Tienen la felicidad, el egocentrismo, la imaginación y la inquietud de los niños. Los Géminis empiezan nuevas actividades y retos con entusiasmo, pero muchas veces les falta la constancia para realizarlos. Consideran que la vida es como un juego y buscan la diversión y nuevas situaciones. Un Géminis suele ser cortés, cariñoso, amable y generoso. A veces utilizan sus atributos para conseguir sus propios objetivos y son capaces de recurrir a la mentira sin perder su encanto con tal de obtener lo que quieren. Se desaniman con facilidad (como los niños) cuando no consiguen lo que quieren, y les gusta recibir atención, regalos y halagos. Los Géminis tienen que esforzarse para no desanimarse cuando las cosas se ponen difíciles. La inteligencia y capacidad mental de los Géminis hacen que les encantan retos cerebrales y nuevos conocimientos, aunque el proceso de aprendizaje tiende a aburrirles. Tienen gran capacidad analítica.', 'yellow', 'Mercurio', 'Yo pienso', 'Aire', 'Ojos de tigre', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(4, 'Cáncer', 'CANCER.png', '20 Mar. 19 Abr', 'El carácter de un Cáncer es el menos claro de todos los signos del zodiaco. Un Cáncer puede ser desde tímido y aburrido hasta brillante y famoso. Los Cáncer son conservadores y les encanta la seguridad y el calor de su hogar. De hecho, para los hombres Cáncer, su hogar es como un nido, un refugio donde ir cuando el estrés de su trabajo es demasiado. La casa de un Cáncer tiende a ser su refugio personal más que un escaparate para deslumbrar a los demás. Un Cáncer entiende que hay momentos para ser sociable y otros momentos para ser solitario. Esto es una de las contradicciones en su carácter. Desde fuera parecen decididos, resistentes, tercos, tenaces, energéticos, sabios e intuitivos. No obstante, los que les conocen desde la intimidad pueden ver un tipo de persona totalmente distinto - alguien sensible sobre todo hacia las personas a las que quiere. Los Cáncer saben identificarse con la situación de los demás por su gran capacidad imaginativa. A veces son demasiados fantasiosos y pretenden construir su vida según un ideal romántico. Les gusta el arte, la música y la literatura y, sobre todo, los artes dramáticos y la acción. Los Cáncer poseen un talento literario o artístico considerable. Su reto personal consiste en reconciliar su conflicto interno. Por una parte les encanta ser extrovertidos, por otro tienen tendencia a retraerse. Si logran reconciliar ambos lados, son capaces de inspirar todo una generación, sobre todo las personas jóvenes, con sus ideas.', 'white', 'Luna', 'Yo siento', 'Agua', 'Perla', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(5, 'Leo', 'LEO.png', '20 Mar. 19 Abr', 'Un Leo es el signo más dominante del zodiaco. También es creativo y extrovertido. Son los reyes entre los humanos, de la misma forma que los leones son los reyes en el reino animal. Tienen ambición, fuerza, valentía, independencia y total seguridad en sus capacidades. No suelen tener dudas sobre qué hacer. Son líderes sin complicaciones, saben dónde quieren llegar y ponen todo su empeño, energía y creatividad en conseguir su objetivo. No temen los obstáculos, más bien crecen ante ellos. En general son buenos, idealistas e inteligentes. Pueden llegar a ser tercas en sus creencias, pero siempre desde una fe y sinceridad absoluta. A un Leo le suelen gustar el lujo y el poder. Sus defectos pueden ser tan amplios como sus virtudes y un Leo excesivamente negativo puede ser una persona arrogante, orgullosa y con muy mal genio. Son capaces de utilizar trucos y mentiras para desacreditar a sus enemigos. También pueden adoptar ciertos aires de superioridad y prepotencia.', 'gold', 'El sol', 'Yo puedo', 'Fuego', 'Diamante', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(6, 'Virgo', 'VIRGO.png', '20 Mar. 19 Abr', 'Virgo, el único signo representado por una mujer, es un signo caracterizado por su precisión, su convencionalidad, su actitud reservada y su afán, a veces hasta obsesión, con la limpieza. Los Virgo suelen ser observadores y pacientes. Pueden parecer a veces fríos, de hecho les cuesta hacer grandes amigos. El hecho que muchas de sus relaciones con otros resultan ser superficiales es porque en realidad los Virgo temen dar riendas a sus sentimientos y les falta tener seguridad en sus emociones y opiniones. Prefieren actuar con reservas y con una disposición agradable. Suelen ser discretos, amables y divertidos con otras personas y pueden ayudar a resolver los problemas de terceros con una habilidad y sensatez que muchas veces les falta en sus propias relaciones personales. Los Virgo tienen encanto y dignidad hasta tal punto que a veces los varones pueden aparecer algo afeminados, aunque no lo sean. Son metódicos, estudiosos y les gusta la lógica. También les gusta aprender y son capaces de analizar las situaciones más complicadas. No obstante, a veces son tan meticulosos que retrasan la conclusión de proyectos complicados. Son muy intuitivos y son capaces de ver todos los lados de un argumento, lo que hace que les cuesta llegar a conclusiones firmes.', 'yellow', 'Mercurio', 'Yo analizo', 'Tierra', 'Jaspe rosado', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(7, 'Libra', 'LIBRA.png', '20 Mar. 19 Abr', 'Los Libra se encuentran entre los signos más civilizados del zodiaco. Tienen encanto, elegancia y buen gusto, son amables y pacíficos. Les gusta la belleza y la armonía y son capaces de ser imparciales ante conflictos. No obstante, una vez que han llegado a una opinión sobre algo, no les gusta que se les contradiga. Les gusta contar con el apoyo de los demás. Un Libra tiende a ser sensible a las necesidades de los demás y suele ser muy sociable. No soportan el conflicto y la crueldad y son muy diplomáticos ante los conflictos. Suelen buscar el consenso ante una situación conflictiva. Saben valorar los esfuerzos de los demás y les gusta vivir y trabajar en equipo. El lado negativo de un Libra es frívolo y es fácil que cambiar de opinión o de lealtades. No les gusta la rutina y muchas veces les falta la capacidad de enfrentarse a los demás. Les encanta el placer y esto les puede llevar a cometer ciertos excesos en su vida. Son muy curiosos, lo que puede ser una virtud si lo invierten en descubrir nuevas cosas, pero también un defecto si les lleva a meterse demasiado en la vida o los asuntos de los demás.', 'blue', 'Venus', 'Yo equilibrio', 'Aire', 'Jade', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(8, 'Escorpio', 'ESCORPIO.png', '20 Mar. 19 Abr', 'El Escorpio es un signo intenso con una energía emocional única en todo el zodiaco. Aunque puedan aparecer tranquilos, los Escorpio tienen una agresión y magnetismo interno escondidos dentro. Son afables, buenos tertulianos, reservados y cortés, pero aunque parezcan estar algo retirados del centro de actividad, en realidad están observando todo con su ojo crítico. El Escorpio es tremendamente poderoso y su carácter puede causar enormes beneficios o grandes riesgos para los demás. Su tenacidad y fuerza de voluntad son únicas pero, sin embargo, son muy sensibles y fácilmente afectados por las circunstancias que les rodean. Son emocionales y fácilmente heridos o aludidos. De hecho, pueden perder totalmente el genio al percibir, incluso erróneamente, que alguien les ha insultado. No saben morderse la lengua y pueden ser muy críticos. Si un Escorpio logra utilizar su enorme energía de forma constructiva es un gran activo para la sociedad y se puede convertir en un gran líder. No obstante, los Escorpio deben aprender a controlarse, porque pueden llegar a ser demasiado críticos y resentidos con los demás. Son excelentes amigos de los que consideran merecen su respeto.', 'red', 'Plutón', 'Yo deseo', 'Agua', 'Turmalina', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(9, 'Sagitario', 'SAGITARIO.png', '20 Mar. 19 Abr', 'El Sagitario es uno de los signos más positivos del zodiaco. Son versátiles y les encanta la aventura y lo desconocido. Tienen la mente abierta a nuevas ideas y experiencias y mantienen una actitud optimista incluso cuando las cosas se les ponen difíciles. Son fiables, honestos, buenos, sinceros y dispuestos a luchar por buenas causas, cueste lo que cueste. Los Sagitario suelen creer en la ética y les gusta seguir los ritos de la religión, de un partido político o de una organización. Esto les puede llevar a tener ciertas tendencias supersticiosas a veces. Les encanta abarcar nuevos proyectos y aprender sobre cosas nuevas. Son intuitivos y buenos organizadores y, aunque son generosos, también son muy cuidadosos, lo que les convierte en buenos gestores de situaciones y proyectos. Algunos Sagitario tienen un gran genio que puede aparecer ante situaciones que para los demás carecen de importancia. También pecan de impaciencia cuando los demás no van al mismo paso que ellos. Son capaces de sacrificarse para realizar un objetivo. Esto hace que a veces son demasiado exigentes con los demás.', 'purple', 'Júpiter', 'Yo veo', 'Fuego', 'Turquesa', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(10, 'Capricornio', 'CAPRICORNIO.png', '20 Mar. 19 Abr', 'Un Capricornio es un de los signos del zodiaco más estables, seguros y tranquilos. Son trabajadores, responsables, prácticos y dispuestos a persistir hasta sea necesario para conseguir su objetivo. Son fiables y muchas veces tienen el papel de terminar un proyecto iniciado por uno de los signos más pioneros. Les encanta la música. Un Capricornio exige mucho de sus empleados, familiares y amigos, pero solo porque se lo exige también a si mismo. Suelen ser personas justas. No se encuentran entre los signos del zodiaco más felices. Más bien tienden a veces hacia el melancolizo y pesimismo. Cuando un Capricornio sufre depresión debe buscar ayuda. De hecho, un Capricornio debe siembre intentar mantener una estabilidad emocional a través de la meditación, respiración o actividades que le ayudan a relajarse y no perder control de sus emociones.', 'gray', 'Saturno', 'Yo utilizo', 'Tierra', 'Ónix', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(11, 'Acuario', 'ACUARIO.png', '20 Mar. 19 Abr', 'Los Acuario tienen una personalidad fuerte y atractiva. Hay dos tipos de Acuario: uno es tímido, sensible, y paciente. El otro tipo es exuberante, vivo y puede llegar a esconder las profundidades de su personalidad debajo de un aire frívolo. Ambos tipos de Acuario tienen una fuerza de convicción y de la verdad muy fuerte y son tan honestos que saben cambiar sus opiniones si aparecen pruebas que muestran lo contrario de lo que pensaban antes. Los Acuario son capaces de ver los dos lados de un argumento por lo que son uno de los signos más tolerantes y sin prejuicios de todo el zodiaco. Están abiertos a la verdad y dispuestos a aprender de todos. Un Acuario es humano, sincero, refinado e idealista. Saben ser perseverantes y expresarse con razón, moderación y, a veces, humor. Casi todos los Acuario son inteligentes, claros y lógicos. Muchos son imaginativos y psíquicos. A veces sienten la necesidad de retirarse del mundo para meditar o pensar. Se niegan a seguir la multitud. A pesar de la personalidad abierta de los acuarios y de su deseo de ayudar a la humanidad, no suelen hacer amigos con facilidad. No se entregan su alma con facilidad.', '#1f3a3d', 'Urano', 'Yo se', 'Aire', 'Aguamarina', 'horoscopo.wav', 'ritual.wav', 'conquista.wav'),
	(12, 'Piscis', 'PISCIS.png', '20 Mar. 19 Abr', 'Un Piscis tiene una personalidad tranquila, paciente y amable. Son sensibles a los sentimientos de los demás y responden con simpatía y tacto al sufrimiento de los demás. Son muy queridos por los demás porque tienen un carácter afable, cariñoso y amable, y no suponen una amenaza para los que quieren tener puestos de autoridad o mayor popularidad. Suelen asumir su entorno y sus circunstancias y no suelen tomar la iniciativa para resolver problemas. Les preocupan más los problemas de otros que sus propios problemas. Los Piscis tienden a existir de forma emocional más que de forma racional, de forma instintiva más que de forma intelectual. No les gusta sentirse confinados y no respetan las convenciones así por las buenas. Pero tampoco tienen la energía o la motivación para luchar contra el poder establecido. Los Piscis muchas veces se retiran hacia un mundo de sueños en el que sus capacidades pueden aportarles beneficios. Tienen una gran capacidad creativa artística.', 'rgb(27, 227, 171)', 'Neptuno', 'Yo soy', 'Agua', 'Amatista', 'horoscopo.wav', 'ritual.wav', 'conquista.wav');
